const addPerson = async (pPerson) => {
    const newPerson = {
     
    brand: pPerson.brand,
    model: pPerson.model,
    generation: pPerson.generation,
    productType: pPerson.productType,
    touchScreen: pPerson.touchScreen,
    screenSize: pPerson.screenSize,
    graphicsCardModel: pPerson.graphicsCardModel,
    ram: pPerson.ram,
    hddCapacity: pPerson.hddCapacity,
    ssdCapacity: pPerson.ssdCapacity,
    
    };

    await fetch("http://localhost:8000/api/v1/sellnow", {
      method: "POST",
      body: JSON.stringify(newPerson),
      headers: { "Content-Type": "application/json" },
    });

   
  };
  const sellnowService={addPerson}

  export default sellnowService;
